message:
Um homem a frente de seu tempo não é aquele que está com a mente voltada para o futuro, do contrário, está com a mente voltada para o passado. É no passado que estão as verdadeiras virtudes, lutas, glórias, heroísmos, é no passado que está o verdadeiro espírito de sabedoria e grandeza que sustenta todos os nobres homens. O futuro é um refúgio onde nos escondemos da competição feroz de nossos antepassados. São as gerações passadas, não as futuras, que vêm bater à nossa porta.

Siga
@RestauracaoDivina

A falsificação e a trapaça fica evidente na atualidade com farsas como o "Diário de Anne Frank" e a estupidez dos "seis milhões" que os alemães supostamente mataram antes que milhões de judeus se rastejassem para os Estados Unidos e outras nações ocidentais.

A estratégia judaica, capítulo IV - A sobrevivência dos mais aptos.

@ProtocolosSion 📖
